import React from 'react';
import styled from 'styled-components';
import Header from '../styles/Header';

const MainDiv = styled.div`
  margin: 30px;
`;

const Index = () => {
  return (
    <MainDiv>
      <Header />
      <h1>Starhop</h1>
    </MainDiv>
  );
};

export default Index;
